package com.rongke.service.impl;import com.baomidou.mybatisplus.service.impl.ServiceImpl;import com.rongke.mapper.ProtocolMapper;import com.rongke.model.Protocol;import com.rongke.service.ProtocolService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;/** * @ProtocolServiceImpl * @协议ServiceImpl * @version : Ver 1.0 */@Servicepublic class ProtocolServiceImpl extends ServiceImpl<ProtocolMapper, Protocol> implements ProtocolService {    @Autowired    private ProtocolMapper protocolMapper;    /**     * @根据条件查找协议     * @param protocol     * @return     */    @Override    public List<Protocol> selectByCondition(Protocol protocol) {        return protocolMapper.selectByCondition(protocol);    }}